(130, 14, '', '11253', '11254', '11255', '11256', '11257', '11258', '11259', 4, 'Blue cornflowers', 70000, 0, 0, 'Cornflower isused in medicinal preparations. It has a ramified stem covered with leaves and usually bears blue, pink, or white flowers. Only the blue colored flowers are used for medicinal purposes. Cornflowers grow 12-30 inches in height and spread up to 12 inches in width. Cornflower is an astringent herb that helps in reducing inflammation.', 'Blue cornflowers.jpg', '2015-03-27', 1, 0.10, 'T'),
