(654, 17, '', '11813', '11814', '11815', '11816', '11817', '11818', '11819', 24, 'King Kashyapa', 0, 0, 0, 'Sarnia green tea comes from the Uva province Sri Lanka. Its a rarely produced tea with wiry looking leaf that is in appearance similar to Orange Pekoe 1, a certain grade of high quality black tea. Some marigold flower petals and some unusual natural exotic from Sri Lanka...', '17_King Kashyapa.JPG', '2016-04-15', 1, 0.00, 'T'),
(655, 17, '', '11820', '11821', '11822', '11823', '11824', '11825', '11826', 22, 'Garayak Tea', 0, 0, 0, 'Ideal as a late night tea, this FBOP1 low grown, a superior grade of fine broken leaves which blended with maple, vanilla and few orange peel cuts gives this tea a very distinct tropical taste..', '17_Garayak Netum.JPG', '2016-04-15', 1, 0.00, 'T'),
(656, 17, '', '11827', '11828', '11829', '11830', '11831', '11832', '11833', 23, 'Journeys of Sheng He', 0, 0, 0, 'This black tea, originates from the Fujian province of China. Lapson Souchong has a smoky aroma and flavour. This Sri Lankan version from the Handunugoda estate is dried over cinnamon sticks, giving the leaves an unusual and distinctive flavour.some fine cinnamon quillins have added for flavour. ', '17_sheng he.jpg', '2016-04-15', 1, 0.00, 'T'),
(657, 17, '', '11834', '11835', '11836', '11837', '11838', '11839', '11840', 28, 'Riti Panna', 0, 0, 0, 'Chun mee, of China in origin, means precious eyebrow due to the shape of its leaves. It is very similar to Gunpowder tea which is here blended. Of a dusty appearance its generally more acidic and less sweet than other green teas. Natural essences and blue coneflowers will sweeten the tea.', '17_riti panna.jpg', '2016-04-15', 1, 0.00, 'T'),
(658, 17, '', '11841', '11842', '11843', '11844', '11845', '11846', '11847', 21, 'Garden of Haggala', 8000, 0, 0, 'This tea is selected from Orange pekoe leaves, a fine grade of unbroken leaves from Nuwara Eliya. Those high grown teas are often referred as the champagne of teas. Large leaves, light in taste. Some rose petals have been added for appearance and a few drops of fine essences for flavour', '17_Garden of Haggala.jpg', '2016-04-15', 1, 999.60, 'T'),
(659, 17, '', '11848', '11849', '11850', '11851', '11852', '11853', '11854', 26, 'Magic Morning Tea', 0, 0, 0, 'This Uva pekoe will give a copper colour cup with slight spicy taste when infused. At times when the conditions are ideal, they can fetch a very high price. Uva teas are sought after by tea experts. Some Exotic essences and rare white cornflower been added to sweeten the taste.', '17_Magic Morning.JPG', '2016-04-15', 1, 0.00, 'T'),
